from datetime import datetime

class User:
    def __init__(self, user_id, user_type):
        self.user_id = user_id
        self.user_type = user_type

class Submission:
    def __init__(self, submission_id, user, status='draft'):
        self.submission_id = submission_id
        self.user = user
        self.status = status
        self.errors = []

    def publish(self):
        if self.status != 'draft':
            raise Exception("Cannot publish a non-draft submission.")
        self.status = 'published'
        print(f"Submission {self.submission_id} published by {self.user.user_id}")

