class SubmissionManager:
    def __init__(self):
        self.submissions = []

    def add_submission(self, submission):
        self.submissions.append(submission)
        print(f"Submission {submission.submission_id} added.")

    def validate_submission(self, submission):
        # Logic to validate submission
        if submission.errors:
            print(f"Submission {submission.submission_id} has errors: {submission.errors}")
        else:
            print(f"Submission {submission.submission_id} validated successfully.")

class Application:
    def __init__(self):
        self.submission_manager = SubmissionManager()

    def run(self):
        # Example workflow
        user = FABSUser(user_id=1, user_type='FABS')
        submission = Submission(submission_id=101, user=user)
        self.submission_manager.add_submission(submission)

        # Simulate a validation check
        self.submission_manager.validate_submission(submission)

        # Simulate publishing a submission
        submission.publish()

